import KeyboardArrowDownIcon from "@mui/icons-material/KeyboardArrowDown";
import {Background} from "./styles";

const OptionButton = ({ title }) => {
  return (
    <Background>
      <button type="button">
        <p>{ title }</p>
        <KeyboardArrowDownIcon />
      </button>
      <div>
        123
      </div>
    </Background>
  );
};

export default OptionButton;
